import React from 'react';

const TicketCard = ({ ticket }) => {
    return (
        <div className="ticket-card">
            <h3>{ticket.title}</h3>
            <p>{ticket.description}</p>
            <p>Contact: {ticket.contact_info}</p>
            <p>Status: {ticket.status}</p>
        </div>
    );
};

export default TicketCard;
